import React from 'react';
import ReactDOM from 'react-dom/client';
import 'bootstrap/dist/css/bootstrap.min.css';
import './index.css';
import LoginPage from './components/pages/LoginPage';
import App from './App';

const root = ReactDOM.createRoot(document.getElementById('root'));

root.render(
  <React.StrictMode>
    <LoginPage 
      setCurrentStudent={(student) => {
        // 로그인 성공 시 App 컴포넌트로 전환
        root.render(
          <React.StrictMode>
            <App />
          </React.StrictMode>
        );
      }} 
      setCurrentPage={(page) => {
        // 페이지 전환 시 App 컴포넌트로 전환
        root.render(
          <React.StrictMode>
            <App />
          </React.StrictMode>
        );
      }}
    />
  </React.StrictMode>
);
